Tornerà dall’11 al 13 settembre a Rimini la terza edizione della più importante manifestazione italiana dedicata al mondo bike. SCOTT Italia sarà presente con oltre 40 modelli della collezione 2021.

Finalmente si alza il sipario sulla III edizione di Italian Bike Festival. Dopo mesi di incertezze, la più grande manifestazione italiana dedicata al mondo della bike industry, agli appassionati di ciclismo e cicloturismo è pronta a confermare le date già annunciate negli scorsi mesi: dall’11 al 13 settembre, la città di Rimini tornerà ad essere la capitale italiana della bicicletta.  L’area expo di oltre 45.000 mq, che abbraccerà ancora una volta il Parco Fellini e il lungomare antistante, ospiterà oltre 300 brand del mondo bici, degli accessori e dell’abbigliamento e darà il benvenuto a ben oltre 40.000 spettatori nel corso della tre giorni.

SCOTT Italia sarà presente con un’area espositiva di livello: 

✅  3 case gonfiabili
✅  200 metri quadrati
✅  40 bici expo MY 2021
✅  Corner tematici
✅  4 gazebi Syncros 

Vieni a trovarci e incontra i tuoi clienti. Lo staff SCOTT sarà a tua disposizione. Contatta il tuo agente di zona per maggiori info.

Durante l’evento verranno messe in atte tutte le normative e le procedure COVID-19 

Anche per il 2020 la partecipazione sarà gratuita ma, rispetto alle passate edizioni, per poter accedere al Villaggio sarà obbligatorio iscriversi online (attraverso la piattaforma disponibile cliccando su questo link italianbikefestival.net/registrati).Una volta completata la registrazione basterà presentarsi con il ticket per poter accedere all’evento.

Per maggiori informazioni su Italian Bike Festival: italianbikefestival.net

